import SideBarUserMenu from "../sidebar/SideBarUserMenu";
export default {
  name: 'SideBar',
  components: {
    SideBarUserMenu: SideBarUserMenu
  },
  mounted: function mounted() {},
  computed: {
    // side menu
    menu: function menu() {
      return this.$router.options.routes.filter(function (item) {
        return item.sideMenuParent;
      })[0].children.filter(function (item) {
        return item.showInSideBar;
      });
    }
  }
};
